import React, { useState } from "react";

const Login = () => {
  const [email, setemail] = useState();
  const [password, setpassword] = useState();
  const [isshown, setisshown] = useState(false);
  const togglePassword = () => {
    setisshown((isshown) => !isshown);
  };
  const loginhandler = () => {};
  const forgotpass = () => {};

  return (
    <form
      class="mb-3 needs-validation StanderdizedBox"
      novalidate
      style={{ width: "90%", height: "55%" }}
    >
      <label>Email Address</label>
      <div class="form-floating">
        <input
          type="email"
          class="form-control"
          id="floatingInput"
          placeholder="name@example.com"
          onChange={(e) => setemail(e.target.value)}
          required
        ></input>
        <label for="floatingInput">example@mail.com</label>
      </div>
      <br></br>
      <label>Password</label>
      <div class="input-group">
        <input
          type={isshown ? "text" : "password"}
          class="form-control"
          id="floatingInput"
          placeholder=""
          onChange={(e) => setpassword(e.target.value)}
          required
        ></input>
        <button
          class="btn btn-outline-secondary"
          type="button"
          id="button-addon2"
          checked={isshown}
          onClick={togglePassword}
        >
          ShowPassword
        </button>
      </div>
      <br></br>
      <div class="col text-center">
        <button
          type="button"
          class="btn btn-primary ButtonSize StanderdizedBox"
          onClick={loginhandler}
        >
          Login
        </button>
      </div>
      <div class="col text-center">
        <button
          type="button"
          class="btn btn-primary ButtonSize StanderdizedBox"
          onClick={() => {
            setemail("Guest@hotmail.com");
          }}
        >
          Guest User
        </button>
      </div>
      <div class="col text-center">
        <button
          type="button"
          class="btn ButtonSize StanderdizedBox"
          style={{ color: "grey" }}
          onClick={forgotpass}
        >
          Forgot Password?
        </button>
      </div>
    </form>
  );
};

export default Login;
